import React from "react";
import { Container } from "../Grid";

// BookList renders a bootstrap list item
export function List({ children }) {
  return (
    <ul className="list-group">{children}</ul>
  );
}

// RecipeListItem renders a bootstrap list item containing data from the recipe api call
export class ListItem extends React.Component {

  render() {
    console.log(this.props);
    console.log()
    return (
      <li>
        <Container className='card-container'>
          <div className='card' id={this.props.id}>

            {/* <h3 className='card-title'>{this.props.homeName} vs. {this.props.awayName}</h3> */}
            <h2 className='card-title'>{this.props.teams.join(' vs. ')}</h2>
            <h4 className='card-title'>Start Time: {this.props.commence_time}</h4>
            <h4 className='card-body'>Home Team: {this.props.home_team}</h4>
            <h4 className='card-body'> {this.props.sites[1].site_nice} <span> home team odds:{this.props.sites[1].odds.h2h[1]}</span></h4>

          </div>
        </Container>
      </li>
    );
  }
}
